import React from 'react';

const Hero = () => {
  return (
    <section className="hero">
      <div className="hero-overlay"></div>
      <div className="hero-content">
        <h1>FASHION MUSE '25</h1>
        <p>
          Elevate your style with AI-powered fashion advice. Explore curated outfits, 
          avatar customization, photo-based recommendations, and more!
        </p>
        <button className="hero-btn">Get Started</button>
      </div>
    </section>
  );
};

export default Hero;
